(802, 'Di awal kegiatan pelaksaan magang mandiri mahasiswa ditunjuk oleh Kasubbag umum untuk menjadi panitia pelaksanaan Survei Pemetaan Wilayah Kerja Statistik (Wilkerstat) Kota Palu Tahun 2022. Tidak hanya menjadi panitia mahasiswa juga ikut serta dalam penerimaan materi pada kegiatan tersebut. Pelaksanaan kegiatan berlangsung selama 3 hari dan bertempat di Hotel Grand Duta.', 'Grand Duta Hotel Kota Palu', '2022-02-23', 'images/logbook/C30119086/23_02_2022_foto.jpeg', 'images/logbook/C30119086/23_02_2022_laporan.pdf', 193, 249),
(803, 'Kegiatan yang dilakukan selama seminggu ini membantu panitia pelaksana kegiatan Pelatihan Petugas Survei Harga Konsumen (SHK) dan Survei Harga Perdagangan Besar (SHPB) Tahun 2022. Adapun tugas yang diberikan yaitu, membuat absensi untuk peserta dan panita, mendokumentasi kegiatan, serta menyiapkan seluruh dokumen yang diperlukan. Kegiatan ini dilaksanakan selama 4 hari oleh Kepala Fungsi Distribusi BPS Kota Palu.', 'Badan Pusat Statistik Kota Palu', '2022-03-07', 'images/logbook/C30119086/07_03_2022_foto.jpeg', 'images/logbook/C30119086/07_03_2022_laporan.pdf', 193, 249),
(804, 'Kegiatan yang saya lakukan selama seminggu ini adalah memeriksa kelengkapan berkas laporan tahuhn yang berakhir pada 31 Desember 2020  31 Desember 2021. Pemeriksaan kelengkapan berupa pemeriksaan  atas dokumen (Surat Perintah Pencairan Dana) SP2D, (Surat Persetujuan Pembayaran)  SPP, (Surat Perintah Membayar)  SPM, (Surat Keputusan) SK, (Kerangka Acuan Kerja) KAK, dan (Berita Acara Serah Terima) BAST.   ', 'Badan Pusat Statistik Kota Palu', '2022-03-14', 'images/logbook/C30119086/14_03_2022_foto.jpeg', 'images/logbook/C30119086/14_03_2022_laporan.pdf', 193, 249);
INSERT INTO `logbook` (`id`, `kegiatan_dilakukan`, `lokasi`, `tanggal`, `foto_kegiatan`, `file_laporan`, `id_pendaftaran`, `id_mhsw`) VALUES
(805, 'Kegiatan yang dilakukan selama 3 hari ini yaitu berpatisipasi sebagai panitia dan ikut serta dalam penerimaan materi kegiatan pelatihan Survei Khusus Konsumsi Rumah Tangga (SKKRT) Triwulanan dan Survei Khusus Lembaga Nonprofit (SKLNP) yang Melayani Rumah Tangga Triwulanan. Adapun rangakaian kegiatan ini yaitu, pelatihan konsep, definisi, serta SOP kegiatan. Kegiatan dilaksanakan oleh Kepala Fungsi Neraca Wilayah BPS Kota Palu. ', 'Badan Pusat Statistik Kota Palu', '2022-04-04', 'images/logbook/C30119086/04_04_2022_foto.jpeg', 'images/logbook/C30119086/04_04_2022_laporan.pdf', 193, 249),
(806, 'Kegiatan yang saya lakukan selama 2 minggu ini adalah membuat draft surat tugas untuk beberapa kegiatan survey yang ada di BPS KOTA PALU. Pekerjaan tersebut membantu pada bagian administrasi kantor. Surat Keputusan yang saya buat yaitu Surat Keputusan Perubahan Petugas Pencacahan Survei Harga Perdagangan Besar (SHPB), Surat Keputusan Pemeriksaan Survei Angkutan Penumpang dan Barang (SAPB), Surat Keputusan Petugas Pencacahan Survei Harga Produsen (SHP), Surat Keputusan Pengolahan Harga Produsen, Surat Keputusan Pencacahan Survei Bidang Jasa Pariwisata, Surat Keputusan Pencacahan Survei Triwulanan Kegiatan Usaha (STKU).', 'Badan Pusat Statistik Kota Palu', '2022-04-07', 'images/logbook/C30119086/07_04_2022_foto.jpeg', 'images/logbook/C30119086/07_04_2022_laporan.pdf', 193, 249),
(807, 'Selama 4 hari saya diminta untuk membuat Berita Acara Serah Terima (BAST) penyerahan barang kepada seluruh pegawai BPS KOTA PALU berupa laptop kantor. Tak hanya itu di waktu yang bersamaan saya juga diminta untuk mengerjakan 2 pekerjaan sekaligus. Yaitu yang pertama membuat Capaian Kinerja Pegawai (CKP) untuk bulan Januari dan Februari. Yang terakhir membuat rekapan absen manual, rekapan lokasi absen, rekapan ini dibuat untuk menentukan PEGAWAI TERTAAT DAN TERPIA. ', 'Badan Pusat Statistik Kota Palu', '2022-04-25', 'images/logbook/C30119086/25_04_2022_foto.jpeg', 'images/logbook/C30119086/25_04_2022_laporan.pdf', 193, 249),
(808, 'Adapun kegiatan yang dilaksanakan adalah, mahasiswa magang mengikuti pelatihan tahap 2 Sensus Penduduk Long Form (SPLF). Proses pelatihan yang diikuti meliputi, Penerimaan materi mengenai tata cara dan proses pelakasanaan kegiatan di lapangan, diselingi dengan games yang berkaitan dengan materi. Selanjutnya pada saat materi selesai, peserta diberikan tugas mengenai materi yang telah diberikan. Kegiatan selanjutnya yaitu, melaksanakan praktek atau implementasi dari materi yang telah diberikan (Latihan melaksanakan SENSUS) dengan menghandirkan warga sebagai contoh dalam melaksanakan tanya jawab pada saat di lapangan nanti.', 'Jazz Hotel Kota Palu', '2022-05-11', 'images/logbook/C30119086/11_05_2022_foto.jpeg', 'images/logbook/C30119086/11_05_2022_laporan.pdf', 193, 249),
(809, 'Setelah pelatihan selesai, waktunya mahasiswa sebagai Pendata Lapangan untuk turun langsung ke lapangan melakukan Pemutakhiran Sensus Penduduk Long Form 2020. Kegiatan pemutakhiran ini masing-masing petugas lapangan diberikan 5 wilayah yang ada di Kota Palu. Saya sendiri ditempatkan di wilayah kecamatan Palu Selatan, Kelurahan Birobuli Utara. Pemutakhiran data adalah kegiatan yang dilakukan sebelum melakukan Sensus Penduduk untuk pemilihan sampel. Jadi, pertanyaan yang kami ajukan kepada responden hanya pertanyaan sederhana saja seperti berapa jumlah anggota rumah tangga, laki-laki maupun perempuan. Apakah ada kejadian kematian, dan pendidikan terakhir dari Kepala keluarga.', 'Jazz Hotel Kota Palu', '2022-05-15', 'images/logbook/C30119086/15_05_2022_foto.jpeg', 'images/logbook/C30119086/15_05_2022_laporan.pdf', 193, 249),
(810, 'Minggu 1 : (21 Februari 2022) sampai (25 Februari 2022)', 'BPKAD Provinsi Jl. Sam Ratulangi', '2022-02-21', 'images/logbook/C30119234/21_02_2022_foto.jpeg', 'images/logbook/C30119234/21_02_2022_laporan.docx', 121, 243),
(811, 'Setelah kegiatan pemutakhiran selesai, maka penarikan sampel dilakukan dan kegiatan sensus pun dilanjutkan. Sensus Penduduk Lanjutan Long Form 2020 dilaksanakan selama satu bulan lamanya dari tanggal 01-30 Juni 2022. Masing-masing petugas 5 blok sensus, yang berarti turun di 5 SLS (Satuan Lingkungan Setempat). Pada kegiatan sensus, pendata lapangan menggunakan aplikasi FASIH, tidak seperti pemutakhiran yang masih menggunakan kertas. Daftar pertanyaan yang kami ajukan pun lebih banyak lagi. Seperti nama-nama anggota rumah tangga, usia masing masing anggota rumah tangga, pendidikan terakhir, kelahiran dan kematian, anggota keluarga yang mengalami disabilitas, migrasi, ada tidaknya peristiwa keguguran dan kepemilikan tanah yang ada di keluarga tersebut.', 'Kecamatan Palu Selatan, Birobuli Utara', '2022-06-01', 'images/logbook/C30119086/01_06_2022_foto.jpeg', 'images/logbook/C30119086/01_06_2022_laporan.pdf', 193, 249),
(812, 'Setelah melakukan sensus penduduk, ketua PPSPM BPS Kota Palu sekaligus Mentor Mahasiswa Magang, mengarahkan kami untuk membantu pekerjaan di PPSPM (Pejabat Penandatanganan Surat Perintah Membayar). Pekerjaan ini menuntut kami untuk melengkapi beberapa surat, diantaranya SP2D Surat Perintah Pencairan Dana, SPM (Surat Perintah Membayar, dan SK (Surat Keputusan), KAK (Kerangka Acuan Kerja). Surat-surat ini terbengkalai dan tidak dilengkapi dari bulan Mei. Oleh karena itu, pekerjaan ini cukup menyita banyak waktu karena, sehingga waktu pengerjaannya cukup lama.', 'Badan Pusat Statistik Kota Palu', '2022-07-04', 'images/logbook/C30119086/04_07_2022_foto.jpeg', 'images/logbook/C30119086/04_07_2022_laporan.pdf', 193, 249),
(813, 'Pelaksanaan kegiatan selama 10 hari terakhir yaitu, membantu kepala subbagian umum melakukan pembaruan harga RAB (Rencana Anggaran Biaya) tahun 2022. Adapun yang dilakukan selama pembaruan harga yaitu, melakukan survei harga barang-barang yang ada di kota palu. Setelah selesai melakuka survei, kemudian harga-harga barang yang telah disurvei di beberapa toko dibuatkah hasil survei.', 'Badan Pusat Statistik', '2022-07-18', 'images/logbook/C30119086/18_07_2022_foto.jpeg', 'images/logbook/C30119086/18_07_2022_laporan.pdf', 193, 249),
(814, '16 Mei - 20 Mei', 'Aksi Cepat Tanggap Palu', '2022-05-20', 'images/logbook/C20119012/20_05_2022_foto.jpg', 'images/logbook/C20119012/20_05_2022_laporan.pdf', 180, 267),
