INSERT INTO `panduan` (`id`, `title`, `text`) VALUES
(1, 'Login dan Pendaftaran', '<h2><strong>Pendaftaran Akun</strong></h2>\r\n\r\n<ul>\r\n	<li>Tekan tombol Daftar pada pojok kanan atas</li>\r\n	<li>Isi data diri anda dengan benar</li>\r\n	<li>Centang konfirmasi dan recaptha</li>\r\n	<li>Klik tombol Register</li>\r\n</ul>\r\n\r\n<h2><strong>Login</strong></h2>\r\n\r\n<ul>\r\n	<li>Tekan tombol Login di pojok kanan atas</li>\r\n	<li>Masukkan email dan password sesuai ketika mendaftar</li>\r\n</ul>\r\n'),
(3, 'Proses Pendaftaran Kegiatan Pertukaran Mahasiswa', '<ul>\r\n	<li>Pilih menu Pendaftaran</li>\r\n	<li>Pilih program Pertukaran Mahasiswa</li>\r\n	<li>Pilih jenis program,&nbsp;</li>\r\n	<li>Daftar Penawaran kegiatan Pertukaran Mahasiswa akan muncul sesuai dengan apa yang ditawarkan oleh Program Studi Anda</li>\r\n	<li>Pilih Penawaran, mahasiswa dapat mengikuti lebih dari satu Penawaran</li>\r\n	<li>Setelah itu periksa detail penawaran dengan seksama dan pastikan telah sesuai</li>\r\n	<li>Tekan tombol Daftar</li>\r\n	<li>Maka akan muncul daftar persyaratan yang nantinya harus dipenuhi</li>\r\n	<li>Tekan tombol Daftar</li>\r\n</ul>\r\n'),
(5, 'Panduan Untuk Alumni', '<p>Untuk petunjuk pengisian aplikasi MBKM FEB Untad untuk user Alumni dapat didownload pada link berikut:</p>\r\n\r\n<p><br />\r\n<a href=\"https://docs.google.com/uc?export=download&amp;id=1fkg1Ofqv52M-niVxiJVJzw9rspm3W-YX\"><strong>ALUMNI - Petunjuk Penggunaan Aplikasi</strong></a></p>\r\n');
